import Login from '../views/Login/Login';
import Servers from '../views/Servers/Servers';
import Register from '../views/Register/Register';
import Profil from '../views/Profile/Profile';
import Admin from '../views/Admin/Admin';
import Validation from '../views/Validation/Validation';

var dashRoutes = [
    { path: "/profil", name: "Profil", icon:"users_single-02", component: Profil},
    { path: "/validate", name: "Validation", icon:"users_single-02", component: Validation},
    { path: "/", name: "Home", icon: "design_image", component: Servers},
];

export default dashRoutes;
